INSERT INTO `tb_configure` VALUES (1, '_title_1_', '标签卡离线时间', 'CARD_OUT_TIME', '10', 23, 1, 1, 1, 0, '秒', 1, NULL, '_comment_1_', '标签卡（非休眠状态）无法定位的时间超过设置值，则标签由“在线状态（地图中图标有颜色）”变为“离线状态（地图中图标为灰色）”。');
INSERT INTO `tb_configure` VALUES (2, '_title_80_', '标签卡离线后在地图上消失时间', 'DEL_CARD_TIME', '10', 23, 2, 1, 1, 0, '秒', 1, NULL, '_comment_80_', '标签卡（非休眠状态）离线状态（地图中图标为灰色）的时间超过设置值，在地图中不再显示图标。');
INSERT INTO `tb_configure` VALUES (3, '_title_34_', '标签卡在休眠状态的离线和消失判断的等待周期', 'IN_STATIC_TIME', '3', 23, 3, 1, 1, 0, '周期', 0, NULL, '_comment_34_', '标签卡（休眠状态）的离线时间=“休眠状态的标签卡判定等待周期”x“标签卡定位频率”+“标签卡（非休眠状态）的离线时间”；\r\n标签卡（休眠状态）的离线后在地图消失时间=“休眠状态的标签卡判定等待周期”x“标签卡定位频率”+“标签卡（非休眠状态）的离线后在地图消失时间”。');
INSERT INTO `tb_configure` VALUES (4, '_title_6_', '区域进出判断时间（UWB定位）', 'JUDGE_AREA_TIME', '5', 24, 4, 1, 1, 0, '秒', 1, NULL, '_comment_6_', '此设置结合“区域进出生效坐标点个数”共同判定是否进出区域。');
INSERT INTO `tb_configure` VALUES (5, '_title_7_', '区域进出生效定位点数（UWB定位）', 'IN_OUT_AREA_NUM', '1', 24, 5, 1, 1, 0, '个', 1, NULL, '_comment_7_', '当在“区域进出判断时间设置值”内：\r\n若定位点在“区域内”的个数超过本设置值，则判定为进入此区域；\r\n若定位点在“区域外”内个数超过本设置值，则判定为离开此区域。');
INSERT INTO `tb_configure` VALUES (6, '_title_109_', '区域进出判断时间（蓝牙定位）', 'JUDGE_AREA_TIME_BLUETOOTH', '5', 25, 6, 13, 1, 0, '秒', 1, NULL, '_comment_109_', '此设置结合“区域进出生效坐标点个数”共同判定是否进出区域。');
INSERT INTO `tb_configure` VALUES (7, '_title_110_', '区域进出生效定位点数（蓝牙定位）', 'IN_OUT_AREA_NUM_BLUETOOTH', '2', 25, 7, 13, 1, 0, '个', 1, NULL, '_comment_110_', '当在“区域进出判断时间设置值”内：若定位点在“区域内”的个数超过本设置值，则判定为进入此区域；若定位点在“区域外”内个数超过本设置值，则判定为离开此区域。');
INSERT INTO `tb_configure` VALUES (8, '_title_2_', '坐标优化（UWB定位）', 'OPTIMAL_FLAG', '1', 26, 8, 1, 0, 1, NULL, NULL, NULL, '_comment_2_', '若设置优化时间3秒，优化距离0.3米，优化权重0.6，则表示：后续3秒内，若（各位置点距离第一个位置点范围在0.3米内点的个数/总位置点个数）≥0.6，则进入坐标优化模式。\r\n进入坐标优化模式后：若坐标一直与第一个坐标点距离在0.3米内，则坐标点一直不动；若任意一个位置点与第一个坐标点距离超出0.3米，则位置移动同时退出坐标优化模式。');
INSERT INTO `tb_configure` VALUES (9, '_title_5_', '坐标优化时间（UWB定位）', 'OPTIMAL_TIME', '3', 26, 9, 1, 1, 0, '秒', 1, NULL, '_comment_5_', '此设置结合坐标优化距离及坐标优化权重一起判断，是否进入坐标优化模式。');
INSERT INTO `tb_configure` VALUES (10, '_title_3_', '坐标优化距离（UWB定位）', 'OPTIMAL_DIS', '0.3', 26, 10, 1, 2, 0, '米', 0, NULL, '_comment_3_', '此设置结合坐标优化权重及坐标优化时间一起判断，是否进入坐标优化模式。');
INSERT INTO `tb_configure` VALUES (11, '_title_4_', '坐标优化权重（UWB定位）', 'OPTIMAL_WEIGHT', '0.6', 26, 11, 1, 2, 0, NULL, 0, 1, '_comment_4_', '此设置结合坐标优化距离及坐标优化时间一起判断，是否进入坐标优化模式。');
INSERT INTO `tb_configure` VALUES (12, '_title_101_', '坐标优化（蓝牙定位）', 'OPTIMAL_FLAG_BLUETOOTH', '1', 27, 12, 13, 0, 1, NULL, NULL, NULL, '_comment_101_', '若设置优化时间3秒，优化距离0.3米，优化权重0.6，则表示：后续3秒内，若（各位置点距离第一个位置点范围在0.3米内点的个数/总位置点个数）≥0.6，则进入坐标优化模式。进入坐标优化模式后：若坐标一直与第一个坐标点距离在0.3米内，则坐标点一直不动；若任意一个位置点与第一个坐标点距离超出0.3米，则位置移动同时退出坐标优化模式。');
INSERT INTO `tb_configure` VALUES (13, '_title_104_', '坐标优化时间（蓝牙定位）', 'OPTIMAL_TIME_BLUETOOTH', '3', 27, 13, 13, 1, 0, '秒', 1, NULL, '_comment_104_', '此设置结合坐标优化距离及坐标优化权重一起判断，是否进入坐标优化模式。');
INSERT INTO `tb_configure` VALUES (14, '_title_102_', '坐标优化距离（蓝牙定位）', 'OPTIMAL_DIS_BLUETOOTH', '0.3', 27, 14, 13, 2, 0, '米', 0, NULL, '_comment_102_', '此设置结合坐标优化权重及坐标优化时间一起判断，是否进入坐标优化模式。');
INSERT INTO `tb_configure` VALUES (15, '_title_103_', '坐标优化权重（蓝牙定位）', 'OPTIMAL_WEIGHT_BLUETOOTH', '0.6', 27, 15, 13, 2, 0, NULL, 0, 1, '_comment_103_', '此设置结合坐标优化距离及坐标优化时间一起判断，是否进入坐标优化模式。');
INSERT INTO `tb_configure` VALUES (16, '_title_29_', '穿墙优化（UWB定位）', 'THROUGH_WALL', '0', 28, 16, 1, 0, 1, NULL, NULL, NULL, '_comment_29_', '需结合“障碍物”区域设置共同生效。');
INSERT INTO `tb_configure` VALUES (17, '_title_30_', '穿墙两定位点最大时长（UWB定位）', 'WALL_TIME', '5', 28, 17, 1, 1, 0, '秒', 1, NULL, '_comment_30_', '在定位数据消失一段时间后再次出现，新出现的定位数据与上一个定位数据的时间相差小于等于设置值，则进行优化，否则由于时间太长，直接使用新的定位数据，不做优化。');
INSERT INTO `tb_configure` VALUES (18, '_title_31_', '穿墙两定位点最大路径（UWB定位）', 'WALL_DIS', '5', 28, 18, 1, 1, 0, '米', 1, NULL, '_comment_31_', '若前后两个点路径因设置了”障碍物“不能直达，则使用寻路查找路径。若两点路径小于等于设置值，则进行优化，否则由于路径太长，直接用新的定位数据，不做优化（注：这个值越大系统计算量越大）。');
INSERT INTO `tb_configure` VALUES (19, '_title_33_', '穿墙定位点距离（UWB定位）', 'WALL_CROSS_DIS', '3', 28, 19, 1, 2, 0, '米', 0, NULL, '_comment_33_', '此设置结合穿墙定位点个数一起判断，是否可以穿墙。');
INSERT INTO `tb_configure` VALUES (20, '_title_32_', '穿墙定位点数（UWB定位）', 'WALL_CROSS_POINT', '5', 28, 20, 1, 1, 0, '个', 1, NULL, '_comment_32_', '定位点超过”穿墙定位点距离设置值“后，连续点的个数超过本设置值，定位数据可穿墙。');
INSERT INTO `tb_configure` VALUES (21, '_title_105_', '穿墙优化（蓝牙定位）', 'THROUGH_WALL_BLUETOOTH', '0', 29, 21, 13, 0, 1, NULL, NULL, NULL, '_comment_105_', '需结合“障碍物”区域设置共同生效。');
INSERT INTO `tb_configure` VALUES (22, '_title_106_', '穿墙两定位点最大时长（蓝牙定位）', 'WALL_TIME_BLUETOOTH', '5', 29, 22, 13, 1, 0, '秒', 1, NULL, '_comment_106_', '在定位数据消失一段时间后再次出现，新出现的定位数据与上一个定位数据的时间相差小于等于设置值，则进行优化，否则由于时间太长，直接使用新的定位数据，不做优化。');
INSERT INTO `tb_configure` VALUES (23, NULL, '穿墙两定位点最大路径（蓝牙定位）', 'BLUETOOTH_THROUGH_MAX_LINE', '5', 29, 23, 0, 1, 0, '米', 1, NULL, NULL, '若前后两个点路径因设置了”障碍物“不能直达，则使用寻路查找路径。若两点路径小于等于设置值，则进行优化，否则由于预警太长，直接用新的定位数据，不做优化（注：这个值越大系统计算量越大）。');
