INSERT INTO `tb_configure` VALUES (218, NULL, '双机热备离线告警时间', 'HOT_STANDBY_OFF_ALARM_TIME', '5', 38, 136, 0, 1, 0, '秒', 0, NULL, NULL, '变为离线状态后，若超过设置值仍处于持续离线状态，则触发告警。');
INSERT INTO `tb_configure` VALUES (219, NULL, '视频画面轮播间隔时长', 'CAMERA_DISPLAY_SPAN', '30', 56, 219, 0, 1, 0, '秒', 5, NULL, NULL, '摄像头越多则轮播间隔时长应越长');
INSERT INTO `tb_configure` VALUES (220, NULL, '基站离线数据轨迹回放', 'PLAYBACK_BASE_STATION_OFFLINE_DATA', '0', 30, 30, 0, 0, 0, NULL, NULL, NULL, NULL, '开启后，基站在离线状态下存储的定位数据（即离线数据），在后续非离线状态上传服务器后，会进行轨迹回放。注意：离线数据不会触发相关告警，故轨迹回放可能会存在与告警不一致的情况。');
INSERT INTO `tb_configure` VALUES (221, NULL, '动画移动速度优化', 'ANIMATION_MOVEMENT_SPEED_OPTIMIZATION', '1', 51, 158, 1, 1, 0, '个', 1, NULL, NULL, '取最新的（设置值）个点的总移动距离和时间算平均速度，作为当前动画点的移动速度。（注：仅作用于实时轨迹，设置数值越大，性能消耗越大，延迟越大。）');
INSERT INTO `tb_configure` VALUES (222, NULL, '区域内车辆自动离开时间', 'TRUCK_MAX_STAY_AREA_TIME', '300', 1009, 220, 0, 1, 0, '分钟', 60, 86400, NULL, '车辆进入区域后，超过设置时间未离开，将判定车辆自动离开此区域。');
INSERT INTO `tb_configure` VALUES (223, NULL, '数据库同步异常告警时间间隔', 'DATABASE_ALARM_CONTINE_TIME', '3600', 39, 137, 0, 1, 0, '秒', 1, NULL, NULL, '若告警状态处于“告警中”，若“告警规则配置中”此类告警的“告警弹窗”为开，则每间隔设置时间会重复弹窗提示。');
INSERT INTO `tb_configure` VALUES (226, NULL, '开启出入口数据修改', 'OPEN_UP_AND_DOWN_WELL', '1', 62, 500, 14, 0, 0, NULL, NULL, NULL, NULL, '开启后，可对出入口数据进行“新增”和“校准”操作。');
INSERT INTO `tb_configure` VALUES (230, NULL, '历史列表拆分显示（分楼层回放）', 'HIS_FLOOR_BREAK_LIST', '32400', 30, 1, 0, 1, 0, '小时', 10, 86400, NULL, '若为“分楼层回放”定位对象在同一张地图中，“前一个定位点消失的时刻”与“下一个定位点出现的时刻”时差超过设置值，则会将一条”轨迹回放历史列表“拆分为两条。');
INSERT INTO `tb_configure` VALUES (231, NULL, '历史列表拆分显示（一张图回放）', 'HIS_ONE_MAP_BREAK_LIST', '32400', 30, 2, 0, 1, 0, '小时', 10, 86400, NULL, '若为“一张图回放”定位对象在同一个场景中，“前一个定位点消失的时刻”与“下一个定位点出现的时刻”时差超过设置值，则会将一条”轨迹回放历史列表“拆分为两条。');
INSERT INTO `tb_configure` VALUES (232, NULL, '历史位置/时刻数据保留时长', 'HIS_CARD_DATA_RETAIN_DAY', '732', 31, 1, 0, 1, 0, '天', 1, NULL, NULL, '数据生成时间超过本配置值的数据将会被自动删除，请谨慎设置。（影响定位对象轨迹回放、区域回放、历史分布等）');
INSERT INTO `tb_configure` VALUES (233, NULL, '历史定位相关其他记录保留时长', 'HIS_OTHER_DATA_RETAIN_DAY', '732', 31, 2, 0, 1, 0, '天', 1, NULL, NULL, '数据生成时间超过本配置值的数据将会被自动删除，请谨慎设置。（影响定位对象的进出区域记录、进出场景记录、上下井记录等）');
INSERT INTO `tb_configure` VALUES (234, NULL, '仅允许在”访客信息“中的访客取卡', 'VISITOR_ONLY_VISITOR_GET_CARD', '1', 1007, 3, 0, 0, 0, NULL, NULL, NULL, NULL, '若开启，则需先在“访客信息”添加访客，同时结合“仅允许在“访客已预约时段”取卡”设置等，判定是否可取卡；\n若关闭，且若此访客不在“访客信息”中，系统会自动新建此访客至“访客信息”，新建此访客的“访客预约记录”（“预约来访开始时间”为“当前时间”，“预约来访结束时间”为“当天24点”），同时结合“仅允许在“访客已预约时段”取卡”设置等，判定是否可取卡。');
INSERT INTO `tb_configure` VALUES (235, NULL, '仅允许在“访客已预约时段”取卡', 'VISITOR_ONLY_TIME_GET_CARD', '1', 1007, 4, 0, 0, 0, NULL, NULL, NULL, NULL, '若开启，则“访客”仅能在“访客预约开始时间”至“访客预约结束时间”之间取卡；\n若关闭，则在任意时间，均允许“访客”取卡。');
INSERT INTO `tb_configure` VALUES (236, NULL, '手动输入身份证需管理员账号登录验证', 'VISITOR_IDCARD_NEED_CHECK', '1', 1007, 5, 0, 0, 0, NULL, NULL, NULL, NULL, '若开启，则需先登录管理员账号，才可手动输入身份证号；\n若关闭，则任何人均可手动输入任意身份证号，同时结合“仅允许在”访客信息“中的访客取卡”设置项和“仅允许在“访客已预约时段”取卡”设置项，判定是否可取卡。\n注意！本系统不对接公安系统，故无法对取卡人员的身份信息、身份证与取卡人员的一致性等进行任何验证，凡手动输入身份证号取卡均可能会出现输入身份证号有误，造成标签卡遗失等情况。');
INSERT INTO `tb_configure` VALUES (237, NULL, '两定位点动画延迟最大时长限制', 'ANIMATION_DELAY_TIME_POINT', '5', 51, 159, 1, 1, 0, '秒', 1, NULL, NULL, '地图动画中的定位对象“即将显示的定位点”与“正在显示的定位点”，两点时差（按定位引擎生成定位点的时间）若超过设置值，则此定位对象将用0.5秒的动画从“正在显示的定位点”到达“即将显示的定位点”。');
INSERT INTO `tb_configure` VALUES (238, NULL, '整体动画延迟最大时长限制', 'ANIMATION_DELAY_TIME', '10', 51, 160, 1, 1, 0, '秒', 1, NULL, NULL, '定位对象“定位引擎最新生成的定位点”与“地图动画正在显示的定位点”，两点时差（按定位引擎生成定位点的时间）若超过设置值，则此定位对象的动画将快速从“地图动画正在显示的定位点”经过两点之间剩余点到达“定位引擎最新生成的定位点”。');
