-- ----------------------------
-- Table structure for tb_accident_alarm
-- ----------------------------
DROP TABLE IF EXISTS `tb_accident_alarm`;
CREATE TABLE `tb_accident_alarm`  (
  `id` bigint unsigned NOT NULL COMMENT '自增主键',
  `uuid` int unsigned NOT NULL COMMENT '事物ID',
  `card_id` int unsigned NOT NULL COMMENT '卡号',
  `utype` tinyint(0) NOT NULL DEFAULT 0 COMMENT '0陌生卡，1人员卡，2车辆卡，3访客卡，4车厢卡，5物资卡',
  `content` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '事故内容',
  `alarm_id` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '事故内容对应的ID号',
  `start_time` datetime(0) NOT NULL COMMENT '上报时间',
  `bs_id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '基站id',
  `scene_id` int unsigned NOT NULL COMMENT '场景ID',
  `building_id` int unsigned NOT NULL COMMENT '建筑ID',
  `floor_id` int(0) NOT NULL COMMENT '楼层ID',
  `area` json NOT NULL COMMENT '所在区域id列表',
  `location` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '坐标',
  `deal_status` tinyint(0) NOT NULL DEFAULT 0 COMMENT '处理状态',
  `deal_person` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '处理人',
  `deal_time` datetime(0) NULL DEFAULT NULL COMMENT '处理时间',
  `comment` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '备注',
  `end_time` datetime(0) NULL DEFAULT NULL COMMENT '结束时间',
  `status` tinyint unsigned NOT NULL COMMENT '告警状态0告警中，1已结束',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `utype`(`utype`) USING BTREE,
  INDEX `start_time`(`start_time`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '事故告警表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for tb_alarm
-- ----------------------------
DROP TABLE IF EXISTS `tb_alarm`;
CREATE TABLE `tb_alarm`  (
  `id` bigint unsigned NOT NULL COMMENT '主键id自增',
  `rule_id` int unsigned NOT NULL COMMENT '规则id',
  `rule_type` tinyint unsigned NOT NULL COMMENT '规则类型5区域超时6静止不动7区域消失8聚集10危险源11陪同12离群14工作超时18车辆超载21姿态异常22区域入侵23区域超限24区域缺员25出入口超限26出入口缺员27安全区域28禁止离开29车辆超速30跌落31强拆32求救33事故34标签低电量35-44设备告警45巡检46点名47-49健康告警',
  `uuid` int unsigned NOT NULL COMMENT '唯一定位对象uuid',
  `utype` int unsigned NOT NULL COMMENT '定位对象类型',
  `card_id` int unsigned NULL COMMENT '卡号',
  `area_id` int unsigned NULL COMMENT '规则触发区域id',
  `scene_id` int unsigned NOT NULL COMMENT '场景id',
  `building_id` int unsigned NOT NULL COMMENT '建筑id',
  `floor_id` int unsigned NOT NULL COMMENT '楼层id',
  `time` int unsigned NOT NULL COMMENT '报警触发时间戳',
  `type` tinyint unsigned NOT NULL COMMENT '老报警类型：2越界3多卡4强拆9区域消失10区域聚众11区域不动12区域超时13进入越界14离开越界15危险源16监护组19陪同报警20离群报警21跌倒报警22基站报警23无卡报警24心率报警25超员报警(低于人数)26超员报警(高于人数)27工作超时28井下超员30超层越界报警31车辆超载32车辆超时33车辆超速34血压报警35脱岗报警36姿态异常37监测报警38监控触发报警39事故上报40标签低电量41设备故障',
  `duration` int(0) NOT NULL DEFAULT 0 COMMENT '报警持续时长秒数',
  `end_time` int unsigned NULL COMMENT '报警结束时间，未结束时为null',
  `end_status` tinyint unsigned NULL COMMENT '报警结束状态0未结束1已结束',
  `status` tinyint(0) NOT NULL DEFAULT 0 COMMENT '0未处理1处理',
  `dispose_time` int(0) NOT NULL DEFAULT 0 COMMENT '报警处理时间戳',
  `is_push` int(0) NOT NULL DEFAULT 0 COMMENT 'APP是否推送 0未推送 1已推送',
  `level` varchar(4) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT 'a' COMMENT '记录聚集等级abc',
  `pos` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '逗号分隔xyz坐标字符串',
  `dispose` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '处理人',
  `comment` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '备注',
  `alarm_info` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '报警内容',
  `ex_info` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '扩展JSON信息不用于查询',
  `areas` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '区域id列表json字段',
  PRIMARY KEY (`id`, `time`) USING BTREE,
  INDEX `rule_id`(`rule_id`) USING BTREE,
  INDEX `rule_type`(`rule_type`) USING BTREE,
  INDEX `uuid`(`uuid`) USING BTREE,
  INDEX `utype`(`utype`) USING BTREE,
  INDEX `card_id`(`card_id`) USING BTREE,
  INDEX `area_id`(`area_id`) USING BTREE,
  INDEX `floor_id`(`floor_id`) USING BTREE,
  INDEX `type`(`type`) USING BTREE,
  INDEX `status`(`status`) USING BTREE,
  INDEX `is_push`(`is_push`) USING BTREE,
  INDEX `level`(`level`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '报警信息记录表' ROW_FORMAT = Dynamic;

