-- ----------------------------
-- Table structure for tb_alarm_rule
-- ----------------------------
DROP TABLE IF EXISTS `tb_alarm_rule`;
CREATE TABLE `tb_alarm_rule`  (
  `id` int unsigned NOT NULL COMMENT '主键id自增',
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '规则名称',
  `type` tinyint unsigned NOT NULL COMMENT '规则类型,区域超时5,静止不动6,区域消失7,聚集8,危险源10,陪同11,离群12,工作超时14,车辆超载18,姿态异常21,区域入侵22,区域超限23,区域超员24,出入口超限25,出入口缺员26,安全区域27,静止离开28,车辆超速29,跌落30,强拆31',
  `is_use` tinyint unsigned NOT NULL COMMENT '0停用1使用',
  `start_time` datetime(0) NULL DEFAULT NULL COMMENT '有效开始时间',
  `end_time` datetime(0) NULL DEFAULT NULL COMMENT '有效结束时间',
  `day_json` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '循环检测设置星期json',
  `time_json` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '时间段json',
  `special_json` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '用于存储额外的属性，默认为{}。目前使用：(注：一下类别中的数字表示类别id)聚众报警8:区域面积与人数字符串:{\"area\":\"4\",\"man\":\"5\"}车辆超载18:{\"truck_overload\": 5}车辆超时17:超时时间(秒)和场景id:{\"truck_overtime\": 60, \"scene_id\":1}井下超员15:人数上限、人数下限和场景id:{\"high_num\":\"100\",\"low_num\":\"2\",\"scene_id\":1}人数限制13:{\"high_num\":\"6\",\"low_num\":\"2\"}工作超时14:考勤组:[1,2,3,4,5]区域超时5:区域超时(秒):{\"area_timeout\": 100} 区域不动6:区域不动(秒):{\"area_without_move\": 100} 19脱岗报警 {“timeout”:1} 单位秒}',
  `comment` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '备注说明',
  `type_things_json` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '事务类型选择{\"is_visitor\":0,\"is_person\":1}等，0不做限制 1适用于所有人员、访客、车辆、物资,标签；类型',
  `area_ids_inverse` tinyint(0) NULL DEFAULT 0 COMMENT '区域是否反选 默认0 反选1',
  `uuids_inverse` tinyint(0) NULL DEFAULT 0 COMMENT '事务(人/车/物等)是否反选 默认0 反选1',
  `is_all_map` tinyint(0) NOT NULL DEFAULT 0 COMMENT '是否是全部定位信号覆盖区域，默认0不是，1是',
  `applicable_object` tinyint(0) NOT NULL DEFAULT 1 COMMENT '适用对象1是定位对象，2是标签类型',
  `alarm_manual_handling_setting` tinyint(0) NOT NULL DEFAULT 0 COMMENT '告警手动处理设置[0处理内容非必填，1处理内容必填]',
  `unbind_alarm` tinyint(0) NOT NULL DEFAULT 1 COMMENT '适用对象解绑后是否报警 默认1报警，0不报警',
  `rule_group_id` int(0) NULL DEFAULT 0 COMMENT '规则组id',
  `is_delete` tinyint(0) NULL DEFAULT 0 COMMENT '删除标志，0为初始值，NULL为已删除',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `name_is_delete`(`name`, `is_delete`) USING BTREE,
  INDEX `type`(`type`) USING BTREE,
  INDEX `is_use`(`is_use`) USING BTREE,
  INDEX `start_time`(`start_time`) USING BTREE,
  INDEX `end_time`(`end_time`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 25 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '报警规则表' ROW_FORMAT = Dynamic;

