  INDEX `alarm_level`(`alarm_level`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 72 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '告警规则配置表' ROW_FORMAT = Dynamic;

