  `type` int unsigned NOT NULL COMMENT '区域类型[1普通,2考勤区域,3电子点名区域,9第一区域,10第二区域,11摄像机区域,12巡检点区域,13障碍物区域,14活动区域,15盲区,16隐藏入侵区域]',
  `is_use` int unsigned NOT NULL COMMENT '是否使用区域',
  `floor_id` int unsigned NOT NULL COMMENT '区域所在楼层id',
  `is_gps` int(0) NOT NULL DEFAULT 0 COMMENT '是否为GPS区域 0UWB区域 1GPS区域',
  `branch_id` int(0) NOT NULL COMMENT '部门id',
  `area` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '实际区域坐标点字符串',
  `is_del` int unsigned NOT NULL COMMENT '是否删除，1删除，0未删除，默认为0',
  `is_show` tinyint(0) NULL DEFAULT 1 COMMENT '属性，1显示，0不显示',
  `template_id` int unsigned NULL COMMENT '模板id',
  `area_code` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL,
  `area_type_option_id` int unsigned NULL COMMENT '电子围栏区域字典选项id',
  `shape` tinyint unsigned NOT NULL COMMENT '区域形状，简便计算[1非圆形，2圆形]',
  `circle_attribute` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '圆形属性例如{\"radius\": 1， \"center\": {\"x\": 1, \"y\": 2}}',
  `extra_attribute` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '存储额外属性，用于区域扩展.',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `name_type_is_del`(`name`, `type`, `is_del`) USING BTREE,
  INDEX `type`(`type`) USING BTREE,
  INDEX `is_gps`(`is_gps`) USING BTREE,
  INDEX `branch_id`(`branch_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 148 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '区域表' ROW_FORMAT = Dynamic;

