-- ----------------------------
-- Table structure for tb_area_alarm
-- ----------------------------
DROP TABLE IF EXISTS `tb_area_alarm`;
CREATE TABLE `tb_area_alarm`  (
  `id` int unsigned NOT NULL,
  `area_id` int unsigned NOT NULL COMMENT '触发规则区域，区域超限、区域缺员使用',
  `scene_id` int unsigned NOT NULL COMMENT '触发规则场景ID，上下井超限、上下井缺员使用',
  `building_id` int unsigned NOT NULL COMMENT '触发规则建筑id，上下井超限、上下井缺员使用',
  `floor_id` int unsigned NOT NULL COMMENT '触发规则楼层id，上下井超限、上下井缺员使用',
  `rule_id` int unsigned NOT NULL COMMENT '规则ID',
  `rule_type` tinyint unsigned NOT NULL COMMENT '告警规则类型',
  `level` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '告警级别',
  `alarm_info` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '告警内容',
  `time` int unsigned NOT NULL COMMENT '告警开始时间',
  `end_time` int unsigned NULL COMMENT '告警结束时间',
  `duration` int unsigned NOT NULL COMMENT '告警持续时间',
  `end_status` tinyint unsigned NOT NULL COMMENT '报警结束状态[0未结束1已结]',
  `status` tinyint unsigned NOT NULL COMMENT '告警处理状态 [0未处理1处理]',
  `dispose` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '处理人',
  `dispose_time` int unsigned NOT NULL COMMENT '报警处理时间戳',
  `comment` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '备注',
  `history_uuids` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '历史参与触发告警的适用对象列表',
  `history_info` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '记录历史最大时刻相关信息',
  PRIMARY KEY (`id`, `time`) USING BTREE,
  INDEX `area_id`(`area_id`) USING BTREE,
  INDEX `scene_id`(`scene_id`) USING BTREE,
  INDEX `building_id`(`building_id`) USING BTREE,
  INDEX `floor_id`(`floor_id`) USING BTREE,
  INDEX `rule_id`(`rule_id`) USING BTREE,
  INDEX `rule_type`(`rule_type`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '区域告警表' ROW_FORMAT = Dynamic;

