  `type` tinyint(0) NOT NULL DEFAULT 1 COMMENT '1文本2图片3时间4日期5单选6多选',
  `sort_key` int(0) NOT NULL DEFAULT 100 COMMENT '排序',
  `is_display` tinyint(0) NULL DEFAULT 1 COMMENT '是否显示',
  `btn_display` tinyint(0) NULL DEFAULT 1 COMMENT '可改显示',
  `is_require` tinyint(0) NULL DEFAULT 0 COMMENT '是否必填',
  `btn_require` tinyint(0) NULL DEFAULT 1 COMMENT '可改必填',
  `btn_type` tinyint(0) NULL DEFAULT 1 COMMENT '可改类型',
  `btn_delete` tinyint(0) NULL DEFAULT 1 COMMENT '是否可删除',
  `type_size` int(0) NULL DEFAULT -1 COMMENT '文本长度-1为无限制',
  `btn_edit` tinyint(0) NOT NULL DEFAULT 1 COMMENT '字段是否可以编辑[1是，0否]',
  `is_sort` tinyint(0) NOT NULL DEFAULT 1 COMMENT '字段是否可以排序[1是，0否]',
  `option_length` int(0) NOT NULL DEFAULT 25 COMMENT '选项长度',
  `option_system_edit` tinyint(0) NOT NULL DEFAULT 0 COMMENT '默认选项是否可以编辑删除1是，0否',
  `option_user_edit` tinyint(0) NOT NULL DEFAULT 1 COMMENT '自定义选项是否可以添加/编辑/删除/,1是，0否',
  `option_sort` tinyint(0) NOT NULL DEFAULT 1 COMMENT '所有选项是否可排序，1是0否',
  PRIMARY KEY (`id`) USING BTREE
