-- ----------------------------
-- Table structure for tb_area_entry_record
-- ----------------------------
DROP TABLE IF EXISTS `tb_area_entry_record`;
CREATE TABLE `tb_area_entry_record`  (
  `id` int unsigned NOT NULL COMMENT '主键id',
  `card_id` int unsigned NOT NULL COMMENT '接触卡卡号',
  `area_id` int unsigned NOT NULL COMMENT '区域id',
  `area_code` varchar(4) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '区域编码',
  `floor_id` int unsigned NOT NULL COMMENT '楼层id',
  `uuid` int unsigned NOT NULL COMMENT '人员唯一id',
  `utype` int unsigned NOT NULL COMMENT '类型，1为人员，2为车辆，3是访客',
  `start_time` int unsigned NOT NULL COMMENT '进入区域时间戳',
  `end_time` int unsigned NOT NULL COMMENT '离开区域时间戳',
  `stay_time` int unsigned NOT NULL COMMENT '停留时间',
  `update_time` datetime(0) NOT NULL COMMENT '事件触发时间 进入/离开',
  `entry_direction` tinyint unsigned NULL COMMENT '进入区域方向,',
  `leave_direction` tinyint unsigned NULL COMMENT '离开区域方向',
  `type` tinyint unsigned NOT NULL COMMENT '进出区域类型，0为uwb进出区域记录，1为gps进出区域记录',
  `is_end` tinyint unsigned NOT NULL COMMENT '记录是否结束,默认为0,1为结束',
  `cal_enter_direction` int unsigned NOT NULL COMMENT '进入方向计算状态[0未计算 1 已计算]',
  `cal_leave_direction` int unsigned NOT NULL COMMENT '离开方向计算状态[0未计算 1 已计算]',
  PRIMARY KEY (`id`, `start_time`) USING BTREE,
  INDEX `area_id`(`area_id`) USING BTREE,
  INDEX `floor_id`(`floor_id`) USING BTREE,
  INDEX `uuid`(`uuid`) USING BTREE,
  INDEX `start_time`(`start_time`) USING BTREE,
  INDEX `update_time`(`update_time`) USING BTREE,
  INDEX `cal_enter_direction`(`cal_enter_direction`) USING BTREE,
  INDEX `cal_leave_direction`(`cal_leave_direction`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci ROW_FORMAT = Dynamic;

