  `id` int unsigned NOT NULL COMMENT '自增id',
  `name` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '区域模板名称',
  `area_style` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '区域模板颜色',
  `relative_start` double NOT NULL COMMENT '区域模板相对开始高度',
  `relative_end` double NOT NULL COMMENT '区域模板相对结束高度',
  `disappear_time` int unsigned NOT NULL COMMENT '灰色卡在区域的消失时间戳，0是跟随系统时间',
  `offline_time` int unsigned NOT NULL COMMENT '在线卡无定位数据后在区域中变灰经过的时间，设置为0时跟随系统配置',
  `uwb_area_entry_exit_detection_time` int unsigned NOT NULL COMMENT '区域进出判断时间（UWB定位）,0是跟随系统',
  `uwb_area_entry_exit_effective_points` int unsigned NOT NULL COMMENT '区域进出生效点数（UWB定位）,0是跟随系统',
  `bluetooth_area_entry_exit_detection_time` int unsigned NOT NULL COMMENT '区域进出判断时间（蓝牙定位）,0是跟随系统',
  `bluetooth_area_entry_exit_effective_points` int unsigned NOT NULL COMMENT '区域进出生效点数（蓝牙定位）,0是跟随系统',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `name`(`name`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '区域模板表' ROW_FORMAT = Dynamic;

