  INDEX `clock_type`(`clock_type`) USING BTREE,
  INDEX `clock_source`(`clock_source`) USING BTREE,
  INDEX `is_del`(`is_del`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '考勤打卡数据' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for tb_attend_history_status
