  `name` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '姓名',
  `uuid` int unsigned NOT NULL COMMENT '人员的uuid',
  `job_details` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '[{\"区域名称\",\"进入时间\",\"离开时间\",\"持续时间\"}]',
  `start_time` int unsigned NULL COMMENT '实际开始时间戳（秒）',
  `end_time` int unsigned NULL COMMENT '实际结束时间戳（秒）',
  `length` int(0) NULL DEFAULT NULL COMMENT '实际工作时间',
  `branch_name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '部门名称',
  `type` tinyint(0) NULL DEFAULT 0 COMMENT '0为真实存在考勤数据，1为填充考勤数据',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '考勤历史状态表' ROW_FORMAT = Dynamic;

