  INDEX `role_branch_id`(`role_branch_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '考勤规则表' ROW_FORMAT = Dynamic;

