  `work_time` int unsigned NOT NULL COMMENT '工作时长',
  `commute_times` tinyint unsigned NOT NULL COMMENT '上下班次数,值为1,2,3',
  `commute_info` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '上下班详细信息,[{\"begin\":\"\",\"end\":\"\",\"advance\":\"\",\"latest\":\"\"}],begin(开始时间),end(结束时间),advance(提前时间),latest(最晚时间)　',
