-- ----------------------------
-- Table structure for tb_attendance_group
-- ----------------------------
DROP TABLE IF EXISTS `tb_attendance_group`;
CREATE TABLE `tb_attendance_group`  (
  `id` int unsigned NOT NULL COMMENT '自增ID',
  `attendance_group_name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '考勤组名称',
  `attendance_type` tinyint unsigned NOT NULL COMMENT '考勤类型,1固定班次，２排班',
  `begin_work_way` tinyint unsigned NOT NULL COMMENT '考勤方式，上班选择，１uwb定位,2考勤机，3第三方服务, 4上下井',
  `end_work_way` tinyint unsigned NOT NULL COMMENT '考勤方式，下班选择，１uwb定位，2考勤机，3第三方服务, 4上下井',
  `area_list_json` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '区域列表json串,[1,2,3]',
  `need_work_json` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '法定节假日,需要上班的安排,{\"2021-04-19\":\"1\"}，{\"日期\":\"班次\"}，休息班次为0',
  `create_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '更新时间',
  `is_del` tinyint unsigned NULL COMMENT '是否删除，1删除，0未删除',
  `is_effective_immediately` tinyint unsigned NOT NULL COMMENT '是否立即生效,1立即生效,2次日生效',
  `quitting_time` float NULL DEFAULT NULL COMMENT '上班超时时长，上班超过 N小时未下班，记为下班缺卡',
  `max_working_overtime` float NULL DEFAULT NULL COMMENT '考勤组要求的工作时长时长N小时',
  `free_shift_json` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '自由班制的班次信息{\"1\":30,\"2\":20},{班次：最短工作时长（分钟）}',
  `is_person` tinyint(0) NOT NULL DEFAULT 0 COMMENT '0自定义 1适用于所有员工',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '考勤组' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for tb_attendance_group_auto_scheduling
-- ----------------------------
DROP TABLE IF EXISTS `tb_attendance_group_auto_scheduling`;
