  `auto_scheduling_json` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '自动排班信息{\"0\":0,\"1\":1,\"2\":1,\"3\":1,\"4\":1,\"5\":1,\"6\":1}，{\"星期\":\"班次id\"}班次id为0即为休息班次',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `attendance_group_id`(`attendance_group_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '自动排班' ROW_FORMAT = Dynamic;

