-- ----------------------------
-- Table structure for tb_attendance_group_manual_scheduling
-- ----------------------------
DROP TABLE IF EXISTS `tb_attendance_group_manual_scheduling`;
CREATE TABLE `tb_attendance_group_manual_scheduling`  (
  `id` int unsigned NOT NULL COMMENT '自增ID',
  `attendance_frequent_json` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '考勤班次id列表json，如[1,2,3,0]，0为休息班次',
  `cycle` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '排班周期{\"name\":\"\",\"cycle_frequent\":[1,2,3,0],\"cycle_day\":3}，0为休息班次',
  `scheduling` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '排班，{\"uuid\":{\"2021-04-20\":\"1\"}}，{\"人员uuid\":{\"日期\":\"班次id\"}},班次id为0即为休息班次',
  `month` timestamp(0) NOT NULL COMMENT '包含年月',
  `attendance_group_id` int unsigned NOT NULL COMMENT '考勤组id',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `attendance_group_id`(`attendance_group_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '手动排班' ROW_FORMAT = Dynamic;

