-- ----------------------------
-- Table structure for tb_attendance_record
-- ----------------------------
DROP TABLE IF EXISTS `tb_attendance_record`;
CREATE TABLE `tb_attendance_record`  (
  `id` int unsigned NOT NULL,
  `date` int(0) NOT NULL COMMENT '日期',
  `uuid` int unsigned NULL COMMENT '关联id',
  `card_id` int unsigned NULL COMMENT '卡号',
  `start_time` timestamp(0) NULL DEFAULT NULL COMMENT '考勤开始时间',
  `end_time` timestamp(0) NULL DEFAULT NULL COMMENT '考勤结束时间',
  `attendance_group_id` int(0) NULL DEFAULT NULL COMMENT '考勤组id',
  `work_time` int(0) NULL DEFAULT 0 COMMENT '工作时长',
  `status` tinyint(0) NULL DEFAULT 0 COMMENT '0初始值 1正常 2迟到 3早退 4矿工 5迟到早退',
  `branch_id` int(0) NULL DEFAULT NULL COMMENT '部门id',
  `duty_id` int(0) NULL DEFAULT NULL COMMENT '职务id ',
  `due_time` int(0) NULL DEFAULT 0 COMMENT '应上时长',
  `attendance_frequent_id` int unsigned NOT NULL COMMENT '班次id',
  `begin_status` tinyint(0) NULL DEFAULT 0 COMMENT '上班打卡状态 0初始值 1正常 2迟到 3早退 4矿工',
  `end_status` tinyint(0) NULL DEFAULT 0 COMMENT '下班打卡状态 0初始值 1正常 2迟到 3早退 4矿工',
  `begin` int(0) NULL DEFAULT NULL COMMENT '应最早打卡时间',
  `end` int unsigned NULL COMMENT '下班最后打卡时间',
  `end_star_time` int(0) NULL DEFAULT NULL COMMENT '上班最后打卡时间',
  `update_time` int(0) NULL DEFAULT NULL COMMENT '更新时间',
  `card_replacement_status` int(0) NULL DEFAULT 1 COMMENT '是否补卡 1未补卡 2已补卡',
  `card_replacement_time` int(0) NULL DEFAULT NULL COMMENT '补卡时间',
  `begin_work_way` tinyint unsigned NOT NULL COMMENT '考勤方式，上班选择，１uwb定位,2考勤机，3第三方服务',
  `end_work_way` tinyint unsigned NOT NULL COMMENT '考勤方式，下班选择，１uwb定位，2考勤机，3第三方服务',
  `area_list_json` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '区域列表json串,[1,2,3]',
  `branch_status` tinyint(0) NULL DEFAULT 1 COMMENT '1为以人员生成 2是以部门生成',
  `alarm_status` tinyint(0) NULL DEFAULT 0 COMMENT '报警状态 1为已报警',
  `due_end_time` int unsigned NULL COMMENT '不包含最晚打卡时间的正常下班时间',
  `efficiency` float NULL DEFAULT -1 COMMENT '效能默认-1',
  `attendance_type` tinyint(0) NULL DEFAULT NULL COMMENT '考勤类型,1固定班次，２排班，3自由排班',
  `quitting_time` float NULL DEFAULT NULL COMMENT '上班超时时长，上班超过 N小时未下班，记为下班缺卡',
  `free_shift_json` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '自由班制的班次信息{\"1\":30,\"2\":20},{班次：最短工作时长（分钟）}',
  PRIMARY KEY (`id`, `date`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '考勤统计主表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for tb_attendance_record_rel
-- ----------------------------
DROP TABLE IF EXISTS `tb_attendance_record_rel`;
CREATE TABLE `tb_attendance_record_rel`  (
  `id` int unsigned NOT NULL,
  `date` int(0) NOT NULL COMMENT '日期',
