  `branch_id` int(0) NULL DEFAULT NULL COMMENT '部门id',
  `duty_id` int(0) NULL DEFAULT NULL COMMENT '职务id ',
  `due_time` int(0) NULL DEFAULT 0 COMMENT '应上时长',
  `attendance_record_id` int(0) NULL DEFAULT NULL COMMENT '原始表id',
  `attendance_frequent_id` int unsigned NOT NULL COMMENT '班次id',
  `begin` int(0) NULL DEFAULT NULL COMMENT '应打开时间',
  `end` int(0) NULL DEFAULT NULL COMMENT '应结束时间',
  `latest` int(0) NULL DEFAULT NULL COMMENT '最晚打开时间',
  `advance` int(0) NULL DEFAULT NULL COMMENT '最早打卡时间',
  `end_status` tinyint(0) NULL DEFAULT 0 COMMENT '下班打卡状态 0初始值 1正常 2迟到 3早退 4矿工',
  `commute_times` tinyint unsigned NOT NULL COMMENT '上下班次数,值为1,2,3',
