  `type` tinyint unsigned NULL COMMENT '报警类型[1血压过高 2血压过低 3过高和过低的中间值]',
  `msg` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '报警文本',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '报警时间',
