-- ----------------------------
-- Table structure for tb_card
-- ----------------------------
DROP TABLE IF EXISTS `tb_card`;
CREATE TABLE `tb_card`  (
  `id` bigint unsigned NOT NULL COMMENT '主键id自增',
  `card_id` int unsigned NOT NULL COMMENT '卡号',
  `power` float NOT NULL DEFAULT -1 COMMENT '电量百分比',
  `card_type` tinyint(0) NULL DEFAULT 0 COMMENT '卡的类型 0默认类型  11胸牌定位标签 25三防定位标签 26防拆定位标签 29防拆物资标签 30普通物资标签 31增强型工业黑卡 32精确定位标签1型 33精确定位标签2型 34定位手环 35安全帽定位标签 36增强型防拆腕带标签 49墨水屏标签 100 导航系统虚拟卡',
  `status` int unsigned NULL COMMENT '状态：0未使用，1使用中，2报废',
  `is_alarm` tinyint unsigned NOT NULL COMMENT '0无报警1有报警',
  `final_coordinates` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '卡的最后记录的坐标信息（json串）',
  `comment` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '备注',
  `update_time` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `online_status` tinyint unsigned NOT NULL COMMENT '在线状态 0 在线 1 离线有信号 2离线无信号',
  `power_lasted` datetime(0) NULL DEFAULT NULL COMMENT '电量最后更新时间',
  `create_time` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `card_type_id` int(0) NOT NULL DEFAULT 1 COMMENT '卡的类型id(4.28)',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `card_id`(`card_id`) USING BTREE,
  INDEX `power`(`power`) USING BTREE,
  INDEX `card_type`(`card_type`) USING BTREE,
  INDEX `status`(`status`) USING BTREE,
  INDEX `card_type_id`(`card_type_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 32 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '卡号统一管理表' ROW_FORMAT = Dynamic;

