  `monitor_type_code` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '监测类型编码',
  `alarm_status` tinyint(0) NOT NULL COMMENT '监测状态1: 报警中 2: 已结束',
  `state` tinyint(0) NOT NULL DEFAULT 0 COMMENT '处理状态0: 未处理 1: 已处理',
  `alarm_level` tinyint(0) NOT NULL COMMENT '报警级别1/2/3',
  `start_time` datetime(0) NOT NULL COMMENT '报警开始时间',
  `end_time` datetime(0) NULL DEFAULT NULL COMMENT '报警结束时间',
  `duration_time` int(0) NOT NULL DEFAULT 0 COMMENT '持续时间',
  `threshold` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '预警阈值',
  `max_num` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '最大值',
  `max_time` datetime(0) NULL DEFAULT NULL COMMENT '最大值时刻戳',
  `min_num` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '最小值',
  `min_time` datetime(0) NULL DEFAULT NULL COMMENT '最小值时刻戳',
  `mean` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '平均值',
  `unit` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '单位',
  `alarm_info` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '报警内容',
  `operation_time` datetime(0) NULL DEFAULT NULL COMMENT '处理时间戳',
  `operation_person` varchar(40) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '处理人',
  `operation_content` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '处理内容',
  `x` float NULL DEFAULT NULL COMMENT 'X设备位移量',
  `y` float NULL DEFAULT NULL COMMENT 'Y设备位移量',
  `z` float NULL DEFAULT NULL COMMENT 'Z设备位移量',
  `is_delete` tinyint(0) NULL DEFAULT 0 COMMENT '是否删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '监测报警' ROW_FORMAT = Dynamic;

