  `coordinate_upper` double NULL DEFAULT NULL COMMENT 'bounding box垂直方向最大坐标',
  `coordinate_down` double NULL DEFAULT NULL COMMENT 'bounding box垂直方向最小坐标',
  `origin_x` double NULL DEFAULT NULL COMMENT '2d地图原点x坐标',
  `origin_y` double NULL DEFAULT NULL COMMENT '2d地图原点y坐标',
  `drop_multiple` double unsigned NOT NULL COMMENT '地图拖拽倍数',
  `upload_2d_time` int(0) NULL DEFAULT NULL,
  `upload_3d_time` int(0) NULL DEFAULT NULL,
  `rotation` double NULL DEFAULT 0 COMMENT '旋转角度',
  `mercator_json` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '墨卡托坐标',
  `wgs84_json` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT 'wgs84坐标',
  `is_del` tinyint unsigned NOT NULL COMMENT '是否删除，1删除，0未删除，默认为0',
  `direction` double NULL DEFAULT NULL COMMENT '方向旋转弧度',
  `direction_vector` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '方向向量',
  `floor_scene_coordinate` json NULL COMMENT '3组楼层和场景坐标，转换使用',
  `storey_id` tinyint unsigned NOT NULL COMMENT '楼层ID',
  `file_2d_path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '楼层2D文件',
  `file_3d_path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '楼层3D文件',
  `file_3d_type` tinyint(0) NOT NULL DEFAULT 1 COMMENT '[1表示单个地图文件 2表示多个地图文件]',
  `map_configure` json NULL COMMENT '地图配置文件',
  `view_json` json NULL COMMENT '3d楼层地图视角信息',
  `origin_data` json NULL COMMENT '2d楼层地图原点信息',
  `sort_number` int(0) NOT NULL DEFAULT 200 COMMENT '排序号',
  `is_sort_number` tinyint(0) NOT NULL DEFAULT 0 COMMENT '是否设置排序',
  `origin_file` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `type`(`type`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 5 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '楼层表' ROW_FORMAT = Dynamic;

