-- ----------------------------
-- Table structure for tb_heart_rate_recording
-- ----------------------------
DROP TABLE IF EXISTS `tb_heart_rate_recording`;
CREATE TABLE `tb_heart_rate_recording`  (
  `id` int(0) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `card_id` int unsigned NULL COMMENT '卡号',
  `abnormal_heart_rate` int unsigned NOT NULL COMMENT '异常心率值',
  `abnormal_count` int(0) NULL DEFAULT 0 COMMENT '异常次数',
  `uuid` int(0) NULL DEFAULT NULL COMMENT '唯一id',
  `maximum_heart_rate` float NOT NULL DEFAULT 0 COMMENT '心率上限',
  `lower_heart_rate` float NOT NULL DEFAULT 0 COMMENT '心率下限',
  `comment` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '备注',
  `status` int(0) NULL DEFAULT 0 COMMENT '状态 0未处理 1已处理',
  `start_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '异常记录开始时间',
  `end_time` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP COMMENT '结束异常的时间',
  `type` tinyint(0) NOT NULL DEFAULT 1 COMMENT '异常类型 1过快 2过慢',
  `state` tinyint(0) NOT NULL DEFAULT 0 COMMENT '检测状态 0异常中 1结束异常 2异常结束（卡解绑、程序重启）',
  `dispose` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '处理人',
  `dispose_time` int(0) NULL DEFAULT 0 COMMENT '处理时间',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `uuid`(`uuid`) USING BTREE,
  INDEX `type`(`type`) USING BTREE,
  INDEX `state`(`state`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '心率异常记录表' ROW_FORMAT = Dynamic;

-- ----------------------------
-- Table structure for tb_help
-- ----------------------------
DROP TABLE IF EXISTS `tb_help`;
CREATE TABLE `tb_help`  (
  `id` bigint unsigned NOT NULL COMMENT '主键id自增',
  `card_id` int unsigned NULL COMMENT '卡号',
  `scene_id` int unsigned NOT NULL COMMENT '场景id',
  `building_id` int unsigned NOT NULL COMMENT '建筑id',
  `floor_id` int unsigned NOT NULL COMMENT '楼层id',
  `time` int unsigned NULL COMMENT '时间戳',
  `type` tinyint unsigned NOT NULL COMMENT '5呼叫6求救7撤离',
  `uuid` int unsigned NULL COMMENT '唯一id',
  `utype` int unsigned NOT NULL COMMENT '定位对象类型',
  `record_count` int unsigned NOT NULL COMMENT '合并求救数量',
  `alarm_info` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL COMMENT '报警内容',
  `pos` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '逗号分隔坐标位置字符串',
  `status` tinyint(0) NOT NULL DEFAULT 0 COMMENT '0未处理1已处理',
  `dispose` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '处理人',
  `comment` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '备注/处理内容',
  `fid` int(0) NULL DEFAULT 0 COMMENT '下发操作对应的fid',
  `call_confirm` tinyint unsigned NOT NULL COMMENT '0未确认1已确认',
  `issue_status` int(0) NULL DEFAULT 2 COMMENT '0下发失败1下发成功2下发中',
  `user_id` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '下发用户id',
  `user_name` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '下发用户名',
  `in_pit` int(0) NULL DEFAULT 0 COMMENT '是否在井下',
  `bs_addr` int unsigned NULL COMMENT '基站地址',
  `dispose_time` int unsigned NOT NULL COMMENT '处理时间',
  `end_time` int unsigned NULL COMMENT '报警结束时间',
  `end_status` tinyint unsigned NOT NULL COMMENT '0未结束1已结束',
  `areas` json NULL COMMENT '区域id列表json字段',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `card_id`(`card_id`) USING BTREE,
  INDEX `scene_id`(`scene_id`) USING BTREE,
  INDEX `building_id`(`building_id`) USING BTREE,
  INDEX `floor_id`(`floor_id`) USING BTREE,
  INDEX `time`(`time`) USING BTREE,
  INDEX `type`(`type`) USING BTREE,
  INDEX `uuid`(`uuid`) USING BTREE,
  INDEX `utype`(`utype`) USING BTREE,
  INDEX `status`(`status`) USING BTREE,
  INDEX `issue_status`(`issue_status`) USING BTREE,
  INDEX `in_pit`(`in_pit`) USING BTREE,
  INDEX `end_time`(`end_time`) USING BTREE,
  INDEX `end_status`(`end_status`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 35 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '呼叫，求救，撤离记录表' ROW_FORMAT = Dynamic;

