  `sex` int unsigned NULL COMMENT '性别',
  `phone` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '联系方式',
  `degree` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '学历',
  `address` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '现居地址',
  `birthday` date NULL DEFAULT NULL COMMENT '出生日期',
  `person_photo` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '头像',
  `nation` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '民族',
  `workplace` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '主要工作地点',
  `origin` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '籍贯',
  `political` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '政治面貌',
  `emergency_person` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '紧急联系人',
  `emergency_phone` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '紧急联系人电话',
  `auth` tinyint unsigned NULL COMMENT '0:普通卡,1:贵宾卡,2:黑名单,3:白名单',
  `status` tinyint unsigned NOT NULL COMMENT '1在职2离职3请假',
  `entry_time` int(0) NULL DEFAULT NULL COMMENT '入职时间',
  `leave_time` int(0) NULL DEFAULT NULL COMMENT '离职时间',
  `sort_num` int(0) NOT NULL DEFAULT 100 COMMENT '排序号',
  `custom_a` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '预设字段1',
  `custom_b` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '预设字段2',
  `custom_c` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '预设字段3',
  `is_del` tinyint unsigned NOT NULL COMMENT '是否删除，1删除，0未删除，默认为0',
  `face_status` tinyint(0) NULL DEFAULT 0 COMMENT '人脸录入状态0否 1是',
  `api_id` int unsigned NULL COMMENT '第三方唯一id',
  `pit_flag` tinyint(0) NOT NULL DEFAULT 0 COMMENT '0未入井，1 已入井，2 已出井',
  `dict_json` json NULL COMMENT '字典扩展',
  `early_warn` tinyint(0) NULL DEFAULT 0 COMMENT ' 1代表预警超员仍然可入井，0代表预警超员后停止检卡入井',
  `alarm` tinyint(0) NULL DEFAULT 0 COMMENT '1代表报警超员仍然可入井，0代表报警超员后停止检卡入井',
  PRIMARY KEY (`uuid`) USING BTREE,
  INDEX `name`(`name`) USING BTREE,
  INDEX `name_initial`(`name_initial`) USING BTREE,
  INDEX `id_code`(`id_code`) USING BTREE,
  INDEX `branch_id`(`branch_id`) USING BTREE,
  INDEX `work_type_id`(`work_type_id`) USING BTREE,
  INDEX `job_num`(`job_num`) USING BTREE,
  INDEX `duty_id`(`duty_id`) USING BTREE,
  INDEX `auth`(`auth`) USING BTREE,
  INDEX `status`(`status`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '人员表' ROW_FORMAT = Dynamic;

