  `role_deny` json NULL COMMENT '原始字段等代码用详情',
  `is_sort` tinyint(0) NOT NULL DEFAULT 1 COMMENT '是否可排序',
  `btn_edit` tinyint(0) NOT NULL DEFAULT 1 COMMENT '是否可编辑',
  `btn_delete` tinyint(0) NOT NULL DEFAULT 1 COMMENT '是否可删除',
  `btn_name` tinyint(0) NOT NULL DEFAULT 1 COMMENT '是否可改名',
  `btn_type` tinyint(0) NOT NULL DEFAULT 1 COMMENT '是否可改类型',
  `btn_type_size` tinyint(0) NOT NULL DEFAULT 1 COMMENT '是否可改长度',
