  `length` int(0) NOT NULL DEFAULT -1 COMMENT '文本长度-1为无限制',
  `name_is_change` tinyint unsigned NOT NULL COMMENT '字段名是否可改',
  `display_is_change` tinyint unsigned NOT NULL COMMENT '显示是否可改',
  `require_is_change` tinyint unsigned NOT NULL COMMENT '必填是否可改',
  `type_is_change` tinyint unsigned NOT NULL COMMENT '类型是否可改',
  `name_is_delete` tinyint unsigned NOT NULL COMMENT '是否可删除',
  `name_is_edit` tinyint unsigned NOT NULL COMMENT '是否可编辑',
