  `option_system_edit` tinyint unsigned NOT NULL COMMENT '默认选项是否可以编辑删除1是，0否',
  `option_user_edit` tinyint unsigned NOT NULL COMMENT '自定义选项是否可以添加/编辑/删除/,1是，0否；',
  `option_sort` tinyint unsigned NOT NULL COMMENT '所有选项是否可排序，1是0否',
