  `up_time` int unsigned NULL COMMENT '上井时间',
  `stay_time` int(0) NULL DEFAULT 0 COMMENT '停留时间',
  `up_down_status` tinyint unsigned NOT NULL COMMENT '上下井状态[0下井 1上井]，默认0',
  `update_time` int unsigned NOT NULL COMMENT '更新时间',
  `type` int(0) NOT NULL DEFAULT 0 COMMENT 'type: 1无记录上井 2无记录下井 3有记录上井 4有记录下井',
  `last_scene_id` int(0) NOT NULL DEFAULT 0 COMMENT '最后出现在的场景id',
