  `pit_sort` bigint(0) NULL DEFAULT NULL COMMENT '更新时间毫秒级',
  `in_pit_time_flag` tinyint(0) NOT NULL DEFAULT 0 COMMENT '0正常1手动校准',
  `up_pit_time_flag` tinyint(0) NOT NULL DEFAULT 0 COMMENT '0正常1手动校准',
