  `theme` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT 'custom-theme-blue' COMMENT '用户主题',
  `role_id` int(0) NULL DEFAULT NULL,
  `is_app` tinyint(0) NOT NULL DEFAULT 0 COMMENT '是否拥有APP使用权限 0无权限 1有权限',
