-- ----------------------------
-- Table structure for tb_visitor
-- ----------------------------
DROP TABLE IF EXISTS `tb_visitor`;
CREATE TABLE `tb_visitor`  (
  `id` int unsigned NOT NULL,
  `uuid` int unsigned NOT NULL COMMENT '访客唯一id',
  `name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '访客姓名',
  `name_initial` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '姓名首字母',
  `phone` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '访客联系方式',
  `id_code` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '访客身份证号',
  `company` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '访客单位',
  `created_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '更新时间',
  `order_time` datetime(0) NULL DEFAULT NULL COMMENT '预约时间',
  `order_code` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '邀请码',
  `photo` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '照片',
  `custom_a` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '预设字段一',
  `custom_b` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '预设字段二',
  `custom_c` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '预设字段三',
  `icon_id` int unsigned NOT NULL COMMENT '访客2D图标ID',
  `icon_follow_type` tinyint unsigned NOT NULL COMMENT '访客2D图标跟随模式，0不跟随，1跟随三维模型',
  `model_id` int unsigned NOT NULL COMMENT '访客3D模型ID',
  `auth` tinyint(0) NULL DEFAULT 0 COMMENT '0:普通卡,1:贵宾卡,2:黑名单,3:白名单',
  `face_status` tinyint(0) NULL DEFAULT 0 COMMENT '人脸录入状态0否 1是',
  `early_warn` tinyint(0) NULL DEFAULT 0 COMMENT ' 1代表预警超员仍然可入井，0代表预警超员后停止检卡入井',
  `alarm` tinyint(0) NULL DEFAULT 0 COMMENT '1代表报警超员仍然可入井，0代表报警超员后停止检卡入井',
  `is_delete` tinyint(0) NULL DEFAULT 0 COMMENT '删除标志，0为初始值，NULL为已删除',
  `third_code` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NULL DEFAULT NULL COMMENT '第三方系统唯一标识符',
  `source` tinyint unsigned NOT NULL COMMENT '数据来源，1: PC端、2:小程序',
  `sex` tinyint unsigned NULL COMMENT '性别，1: 女性、2:男性',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `uuid`(`uuid`) USING BTREE,
  UNIQUE INDEX `id_code_is_delete`(`id_code`, `is_delete`) USING BTREE,
  INDEX `name_initial`(`name_initial`) USING BTREE,
  INDEX `created_time`(`created_time`) USING BTREE,
  INDEX `update_time`(`update_time`) USING BTREE,
  INDEX `third_code`(`third_code`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_0900_ai_ci COMMENT = '访客数据表' ROW_FORMAT = Dynamic;

